$(document).ready(function() {
	$('.alert').alert();
	$('.btn').mouseover(function() {
		$(this).tooltip('show');
	});
	$('a').mouseover(function() {
		$(this).tooltip('show');
	});

	$('.print').click(function() {
		window.print();
	});

	$('#date').datepicker({
		format: 'dd-mm-yyyy'
	});

	$(function() {
		$("#name").autocomplete({
			source: "products/get_product_autocomplete" // path to the get_birds method
		});
	});
});
